public static class InputsTranslator
{
    public static char[][] GetCharArray(string maze)
    {
        maze = maze.Substring(1, maze.Length - 2);
        maze = maze.Replace("\"", "");

        string[] mazeSplitted = maze.Split("],[");

        char[][] result = new char[mazeSplitted.Length][];
        for (int i = 0; i < mazeSplitted.Length; i++)
        {
            result[i] = mazeSplitted[i]
                .Replace("[", "")
                .Replace("]", "")
                .Replace(",", "")
                .ToCharArray();
        }

        return result;
    }
}

public class Solution
{
    int?[,] mazeMap;

    public int NearestExit(char[][] maze, int[] entrance)
    {
        mazeMap = ConvertMazeIntoMap(maze);
        Cell initCell = new Cell { RowIndex = entrance[0], ColIndex = entrance[1] };

        Queue<List<Cell>> queue = new Queue<List<Cell>>();
        queue.Enqueue(new List<Cell> { initCell});
        while(queue.Count > 0)
        {
            List<Cell> currentCellsList = queue.Dequeue();
            List<Cell> cellsToProceed = GetNearCells(currentCellsList, mazeMap);
            if (cellsToProceed.Count == 0 && queue.Count == 0)
            {
                return -1;
            }
            else if (ContainsExit(cellsToProceed, initCell))
            {
                //return mazeMap[currentCellsList.Last().RowIndex, currentCellsList.Last().ColIndex].Value + 1;
                return currentCellsList.Count;
            }
            else
            {
                //SetMapValues(cellsToProceed, 
                //    mazeMap, 
                //    mazeMap[currentCellsList.Last().RowIndex, currentCellsList.Last().ColIndex].Value);

                foreach (Cell cell in cellsToProceed)
                {
                    List<Cell> expandedPath = new List<Cell>();
                    expandedPath.AddRange(currentCellsList);
                    expandedPath.Add(cell);
                    queue.Enqueue(expandedPath);
                }
            }
        }

        return -1;
    }

    public class Cell
    {
        public int RowIndex;
        public int ColIndex;
        //public int StepsCount;
        //public bool IsExit;
    }

    private int?[,] ConvertMazeIntoMap(char[][] maze)
    {
        int?[,] map = new int?[maze.Length, maze[0].Length];
        for (int i = 0; i < maze.Length;i++)
        {
            for (int j = 0;  j < maze[0].Length;j++)
            {
                if (maze[i][j] == '+')
                {
                    map[i, j] = null;
                }
                else
                {
                    map[i, j] = 0;
                }
            }
        }

        return map;
    }

    /// <summary>
    /// Заполняет соседние ячейки количеством ходов и возвращает список ячеек для обработки
    /// </summary>
    /// <param name="currentCell"></param>
    /// <param name="mazeMap"></param>
    /// <param name="processedCells"></param>
    /// <returns></returns>
    private List<Cell> GetNearCells(List<Cell> currentCellsList, int?[,] mazeMap)
    {
        Cell currentCell = currentCellsList.Last();

        List<Cell?> nearCells = new List<Cell?>()
        {
            GetCell(currentCell.RowIndex + 1, currentCell.ColIndex, mazeMap),
            GetCell(currentCell.RowIndex, currentCell.ColIndex - 1, mazeMap),
            GetCell(currentCell.RowIndex - 1, currentCell.ColIndex, mazeMap),
            GetCell(currentCell.RowIndex, currentCell.ColIndex + 1, mazeMap)
        };

        List<Cell> activeCells = new List<Cell>();

        foreach (Cell? cell in nearCells)
        {
            bool cellIsOk = cell != null
                && !currentCellsList.Any(c => c.RowIndex == cell.RowIndex && c.ColIndex == cell.ColIndex);
            if (cellIsOk)
            {
                activeCells.Add(cell);
            }
        }

        return activeCells;
    }

    private bool ContainsExit(List<Cell> cells, Cell initCell)
    {
        foreach (Cell cell in cells)
        {
            bool isExit = cell.RowIndex == 0
                || cell.RowIndex == mazeMap.GetLength(0) - 1
                || cell.ColIndex == 0
                || cell.ColIndex == mazeMap.GetLength(1) - 1;
            isExit = isExit && !(cell.RowIndex == initCell.RowIndex && cell.ColIndex == initCell.ColIndex);
            if (isExit)
            {
                return true;
            }
        }
        return false;
    }

    private Cell? GetCell(int rowIndex, int colIndex, int?[,] mazeMap)
    {
        bool isCellNull = rowIndex < 0
            || rowIndex > mazeMap.GetLength(0) - 1
            || colIndex < 0
            || colIndex > mazeMap.GetLength(1) - 1
            || mazeMap[rowIndex, colIndex] == null;

        if (isCellNull)
        {
            return null;
        }
        else
        {
            return new Cell
            {
                ColIndex = colIndex,
                RowIndex = rowIndex
            };
        }
    }

    private void SetMapValues(List<Cell> cells, int?[,] mazeMap, int additValue)
    {
        foreach (Cell cell in cells)
        {
            mazeMap[cell.RowIndex, cell.ColIndex] = additValue + 1;
        }
    }
}